import axios from '../axios';

/*
* 发送请求获取成绩数据*/
const request = (studentID, studentPassword) =>{
  axios.ajax({
    url: '',
    data: {
      studentID: studentID,
      studentPassword: studentPassword,
      //是否已上J类 0/1
      isAttendJLesson: '',
      //是否已上通核 0/1
      isAttendSLesson: '',
      //外语类总学分
      isAttendFLesson: '',
      //通识类总学分
      totalCreditOfGeneralCourse: '',
      //军体类总学分
      totalCreditOfPACourse: '',
      //自然科学类总学分
      totalCreditOfNSCourse: '',
      //专业必修课程总学分
      totalCreditOfNCourse: '',
      //专业选修课程总学分
      totalCreditOfCCourse: '',
    }
  }).then((result)=>{
    if (result === 0){
      return({
        studentDataResult: result,
      });
    }
  })
};

export default request();
